    <button disabled={(page+1===currentPage)} onClick={()=>onClick(page+1)} id={id} data-testid="button-component" className={styles.button}>
      {/* {title ==="PREV" ?  setPage(page-1): title==="NEXT"? setPage(page+1):1 } */}
      {page+1}
    </button>
  );
}

export default Button;
